import React from 'react';

class WorkGrid extends React.Component {
	render() {
		const { slidesState } = this.props;
		console.log(slidesState.firstImages);
		let WorkItem = slidesState.firstImages.map((work, i) => (
			<div className="grid-image-div">
				<img src={work} alt="" className="grid-img" />
			</div>
		));
		return <>{WorkItem}</>;
	}
}

export default WorkGrid;
